import { LoginWithProviderService } from './LoginWithProviderService'
import { LoginWithProviderUseCase } from './LoginWithProviderUseCase'

function createLoginWithProviderUseCase(
  loginWithProviderService: LoginWithProviderService,
): LoginWithProviderUseCase {
  return function (provider) {
    return loginWithProviderService(provider)
  }
}

export { createLoginWithProviderUseCase }
